import { AnimatePresence, motion } from "framer-motion";
import VarTableRowData from "./var-table-row-data";

type VarTableBodyProps = {
  incomingVariablesBody: Map<string, any>;
};

export default function VarTableBody({ incomingVariablesBody }: VarTableBodyProps) {
  return (
    <tbody className="w-full">
      <AnimatePresence>
        {Array.from(incomingVariablesBody.entries()).map(([key, values]) => (
          <motion.tbody
            key={key}
            initial={{ opacity: 0, height: 0 }}
            animate={{ opacity: 1, height: "auto" }}
            exit={{ opacity: 0, height: 0 }}
            transition={{ duration: 0.4, ease: "easeInOut" }}
            className="overflow-hidden"
          >
            <tr className="w-full">
              <VarTableRowData values={values} />
            </tr>
          </motion.tbody>
        ))}
      </AnimatePresence>
    </tbody>
  );
}
